#' @param sig_Pv : progression to symptomatic: presymptomatic vaccinated : numeric
#' @param gA_Auv : recovery of asymptomatic:  vaccinated : numeric
#' @param gA_Av : recovery of asymptomatic: asymptomatic vaccinated : numeric
#' @param rho_Iuv : fraction dying:  vaccinated : numeric
#' @param gI_Iuv : leaving the symptomatic class:  vaccinated : numeric
#' @param rho_Iv : fraction dying: ill vaccinated : numeric
#' @param gI_Iv : leaving the symptomatic class: ill vaccinated : numeric
#' Values for model times : numeric 
#' @param tstart : Start time of simulation : numeric
